import React from 'react';
import './Home.css';

function Home() {
  return (
    <section className="home">
      <div className="home-content">
        <h2 className="home-title">Welcome to My Website</h2>
        <p className="home-description">Explore our services and learn more about us.</p>
      </div>
    </section>
  );
}

export default Home;
